    "# Drop irrelevant ID column\n",
    "df.drop(columns=['id'], inplace=True, errors='ignore')\n",
    "\n",
    "# Fill missing BMI with median\n",
    "df['bmi'] = df['bmi'].fillna(df['bmi'].median())\n",
    "# Remove or group 'Other' gender (very few)\n",
    "\n",
    "df = df[df['gender'] != 'Other']  # or map to majority class if needed\n",
    "\n",
    "# Optionally treat 'Unknown' in smoking\n",
    "df['smoking_status'] = df['smoking_status'].replace('Unknown', 'never smoked')\n"
