    "from xgboost import XGBClassifier\n",
    "\n",
    "# Use your best parameters found from tuning\n",
    "best_xgb_model = XGBClassifier(\n",
    "    subsample=0.7,\n",
    "    n_estimators=100,\n",
    "    max_depth=7,\n",
    "    learning_rate=0.05,\n",
    "    colsample_bytree=0.7,\n",
    "    use_label_encoder=False,\n",
    "    eval_metric='logloss',\n",
    "    random_state=42\n",
    ")\n",
    "\n",
    "# Fit the model on the SMOTE-balanced training data\n",
    "best_xgb_model.fit(X_train_sm, y_train_sm)\n"
